detaileddescription.para:
Please use this element if you want to use the model dynamics of an accelerometer defined, using the kinematics, as the time derivative of the frame linear velocity: \[ v = J 
u \] The AccelerometerMeasurementDynamics represents the following equation in the continuous time: \[ \dot{v}^{accelerometer} = \dot{J} 
u + J \dot{
u} = \dot{J} 
u + J^{base} \dot{v}^{base} + J^{joints} \ddot{s} \] where the joint acceleration is given by the forward dynamics equation.
